The Alex Jones Show

Wednesday February 25th, 2009.


Hour-1: News and open lines
Hour-2: Open lines and news
Hour-3: Randy Brogdon and open lines
Hour-4: Open lines and F. William Engdahl


Alex continues his coverage of the Tenth Amendment issue. He welcomes to the show 

Oklahoma Senator Randy Brogdon, who has sponsored SJR 10, legislation asserting state 

sovereignty. Alex also talks with Asia Times Online writer and researcher, F. William 

Engdahl, author of A Century of War: Anglo-American Oil Politics and the New World Order. 

Alex also tackles the important issues of the day and takes your calls.

